import './Register.css';
import React,{useState,useEffect,setState,useParams} from 'react';
import Axios from 'axios';


function Register() {

  const [nameReg, setnameReg] = useState("");
  const [emailReg, setemailReg] = useState("");
  const [passwordReg, setPasswordReg] = useState("");

  
   
  const register = () => {
   Axios.post("http://localhost:5001/register", {name: nameReg, email: emailReg, password: passwordReg,
  })
  .then((response) => {
   console.log((response)=>{
   })
   
  })
  .catch((err)=>(err.response.data));
  ("Registered Successfully");
  
  };



 

  return (
  <div className="App">
    <div className="top_section">
        <img src="../edgeforce.jpg" alt=" " width="250" height="50"/><h1 style={{marginTop:0, marginLeft:170}}>Inventory Management System</h1>
      </div>
    <div className="registration" style={{ 
      marginLeft:"180px",
        padding:"15px",
        maxWidth: "500px",
        alignContent: "center"}}>
    <center><h1 style={{marginLeft:"400px"}}>Registration</h1></center><br/><br/>


    <input type="text"
    placeholder = "Enter Your Name" 
    onChange={(e) => {
      setnameReg(e.target.value);
    }}
    
    />
    <input type="text"
    placeholder = "Enter Email" 
    onChange={(e) => {
      setemailReg(e.target.value);
    }}/>

    <input type="password"
    placeholder = "Enter Password" 
     onChange={(e) => {
      setPasswordReg(e.target.value);
    }}
    />
    <br/><br/>
    <input onClick={register} type="button" value="Register"/><br/>
    <a href = "/login" type="button">Already have an account ? &nbsp;&nbsp; Login</a>
    </div>
   
    </div>
  );
}


export default Register;
